                    "id": "cG9zdDozNDkw",
                    "excerpt": "<p>Pman Represents SwC on Big Bet Poker Longtime SwC regular &#8220;Pman&#8221; recently made his first appearance on the high stakes poker live stream &#8220;Big Bet Poker&#8221;. Fellow SwC players joined the lobby chat to watch the action and root for Pman in his high stakes debut. Taking a seat at the $25/$50 No Limit Hold&#8217;em &hellip; <a href=\"https://swcpoker.club/posts/crypto-poker-cash-games/watch-swc-poker-player-pman-play-high-stakes-live-stream\" class=\"more-link\">Continue reading<span class=\"screen-reader-text\"> &#8220;SwC Player &#8220;Pman&#8221; Makes High Stakes Live Stream Debut&#8221;</span></a></p>\n",
                    "content": "<h2><span style=\"color: #ffcc00\">Pman Represents SwC on Big Bet Poker<br />\n</span></h2>\n<p>Longtime SwC regular &#8220;Pman&#8221; recently made his first appearance on the high stakes poker live stream &#8220;Big Bet Poker&#8221;. Fellow SwC players joined the lobby chat to watch the action and root for Pman in his high stakes debut.</p>\n<p>Taking a seat at the $25/$50 <a href=\"https://swcpoker.club/poker-rules/flop-games/texas-hold-em\">No Limit Hold&#8217;em</a> table, Pman had the opportunity to follow up his recent 2nd place finish in an event at the 2023 World Series of Poker while representing SwC Poker on the grand stage.</p>\n<p>We are proud to say that Pman represented SwC and it&#8217;s community of bitcoin poker players well. His calm demeanor and calculated moves displayed the poise of a seasoned player, earning the respect of table mates, commentators, and viewers.</p>\n<h3><span style=\"color: #ffcc00\">Hand of the Night<br />\n</span></h3>\n<p>The largest hand of the night saw Pman and his opponent involved in a $14,000 pot.</p>\n<p>Both players got all-in on a flop of J♦ T♥ 7♣, with Pman holding the 9♦ 8♦ for a straight.</p>\n<h3><span style=\"color: #ffcc00\">Watch Pman&#8217;s High Stakes Live Stream Vlog<br />\n</span></h3>\n<p><a href=\"https://www.youtube.com/watch?v=Qw3e8FE-vIE\"><img decoding=\"async\" loading=\"lazy\" class=\"aligncenter size-large wp-image-3500\" src=\"https://swcpoker.club/wp-content/uploads/2023/07/Pman-1024x576.jpg\" alt=\"&quot;Pman&quot; Plays High Stakes Live Stream\" width=\"840\" height=\"473\" srcset=\"https://swcpoker.club/wp-content/uploads/2023/07/Pman-1024x576.jpg 1024w, https://swcpoker.club/wp-content/uploads/2023/07/Pman-300x169.jpg 300w, https://swcpoker.club/wp-content/uploads/2023/07/Pman-768x432.jpg 768w, https://swcpoker.club/wp-content/uploads/2023/07/Pman-1200x675.jpg 1200w, /static/5e79f9325e77432448ede92610f18f58/Pman.jpg 1280w\" sizes=\"(max-width: 709px) 85vw, (max-width: 909px) 67vw, (max-width: 1362px) 62vw, 840px\" /></a><br />\nTo find out the result of this hand and the outcome of Pman&#8217;s performance, we invite you to follow this link to <a href=\"https://www.youtube.com/watch?v=Qw3e8FE-vIE\" target=\"_blank\" rel=\"noopener\">Pman&#8217;s vlog on YouTube</a> where he documents the experience and reveals insight behind his play.</p>\n<p>Watch the <a href=\"https://www.youtube.com/watch?v=eRAMBU8zRRM\" target=\"_blank\" rel=\"noopener\">full episode of Big Bet Poker on YouTube</a>.</p>\n",
