                    "id": "cG9zdDozNDEy",
                    "excerpt": "<p>Bad Beat Jackpot Climbing The Bad Beat Jackpot has been steadily increasing since it was most recently hit in April, and is currently standing at over 2,000,000 μBTC! Play now at the specially marked &#8220;Jackpot&#8221; No Limit Hold&#8217;em tables found in the cash game lobby for your chance to win. To be eligible, at least &hellip; <a href=\"https://swcpoker.club/posts/bitcoin-jackpots/bad-beat-jackpot-now-over-2-btc\" class=\"more-link\">Continue reading<span class=\"screen-reader-text\"> &#8220;Bad Beat Jackpot Now Over 2 BTC&#8221;</span></a></p>\n",
                    "content": "<h2><span style=\"color: #ffcc00\">Bad Beat Jackpot Climbing<br />\n</span></h2>\n<p>The Bad Beat <a href=\"https://swcpoker.club/posts/bitcoin-jackpots/bad-beat-jackpot-starting-at-100k\">Jackpot</a> has been steadily increasing since it was most recently hit in April, and is currently standing at over 2,000,000 μBTC!</p>\n<p>Play now at the specially marked &#8220;Jackpot&#8221; No Limit Hold&#8217;em tables found in the cash game lobby for your chance to win.</p>\n<p>To be eligible, at least four players must be dealt into the hand. The qualifier for a bad beat is Aces Full of Kings or better being beaten. Both players must use both hole cards for a qualifying Full House or Straight Flush. Pocket pairs are required for a qualifying Four of a Kind.</p>\n<p>In other news, in case you&#8217;ve missed it, we&#8217;ve recently added several new game types. The new games include <a href=\"https://swcpoker.club/posts/blockchain-poker-announcements/drawmaha-sviten-the-greatest-poker-game-now-at-swc\">Drawmaha</a>, <a href=\"https://swcpoker.club/posts/poker-rules/flop-games/6-card-omaha-poker\">6-Card PL Omaha</a> and <a href=\"https://swcpoker.club/posts/poker-rules/draw-poker-games/2-7-single-draw-poker\">NL 2-7 Single Draw</a>. These new games are available now in the cash game lobby. They can also be played with no risk in one of our many freeroll tournaments.</p>\n<p>We also have exciting additions for our tournament players. The <a href=\"https://swcpoker.club/posts/bitcoin-poker-tournaments/golden-ticket-tournament-leaderboard\">Golden Ticket Leaderboard</a> promotion is running now to go along with our revamped daily tournament schedule featuring increased prize pools!</p>\n<p>Play in specially marked tournaments throughout the week to participate. Finish in the money to earn Golden Ticket Leaderboard points. At the end of the week the Top 10 players on the leaderboard will be awarded tournament tickets, including a 5k BIG BTC ticket for the overall winner!</p>\n",
