                    "id": "cG9zdDozMzE2",
                    "excerpt": "<p>Drawmaha! We&#8217;re thrilled to announce the latest addition to our lineup of exciting poker games: Drawmaha. Elevate your poker experience to new heights with this exhilarating blend of 5-Card Draw and Pot Limit Omaha. Drawmaha, also known as Sviten Special, is a split pot game that guarantees non-stop action and excitement in every hand. With &hellip; <a href=\"https://swcpoker.club/posts/blockchain-poker-announcements/drawmaha-sviten-the-greatest-poker-game-now-at-swc\" class=\"more-link\">Continue reading<span class=\"screen-reader-text\"> &#8220;Drawmaha (Sviten) &#8211; The Greatest Poker Game now at SwC&#8221;</span></a></p>\n",
                    "content": "<h3><span style=\"color: #ffcc00;\">Drawmaha!</span></h3>\n<p>We&#8217;re thrilled to announce the latest addition to our lineup of exciting poker games: Drawmaha. </p>\n<p>Elevate your poker experience to new heights with this exhilarating blend of 5-Card Draw and Pot Limit Omaha.</p>\n<p>Drawmaha, also known as <a href=\"https://swcpoker.club/poker-rules/draw-poker-games/drawmaha-sviten-poker\">Sviten Special</a>, is a split pot game that guarantees non-stop action and excitement in every hand. With it&#8217;s unique combination of Draw and Omaha strategies, it&#8217;s a game that will keep you on the edge of your seat.</p>\n<h6><span style=\"color: #ffcc00;\">How it works</span></h6>\n<p>Each player is dealt five face-down cards, followed by the first round of betting. Just as in Omaha, the game is often played as Pot-Limit to ensure a perfect balance of intense action without going overboard.</p>\n<p>After the initial betting round, a standard three-card flop is dealt. Players must then decide how many of their cards they wish to exchange. You have the option to keep all of your cards or exchange up to all five in a single draw.</p>\n<h6><span style=\"color: #ffcc00;\">Here&#8217;s the twist</span></h6>\n<p>If you choose to exchange only one card, the dealer will reveal that top card off the deck to all players. You are then given the option to keep that card, or to discard it and opt for the next card in the deck, which remains face down.</p>\n<p>Once all players have their new cards the game proceeds as normal with subsequent turn and river streets.</p>\n<p>At showdown, the pot is split between the player with the best Omaha hand (2 cards from their hand, 3 from the board) and the player with the best 5-Card Draw hand (all 5 cards from their hand).</p>\n<h6><span style=\"color: #ffcc00;\">Rinse and repeat</span></h6>\n<p>Drawmaha is a game designed for action lovers and strategic thinkers alike. Whether you&#8217;re a newcomer or an experienced poker player seeking a fresh adventure, Drawmaha is sure to provide endless thrills and strategic opportunities.</p>\n<p>Experience the excitement of Drawmaha today and redefine your poker journey like never before!</p>\n<p><span style=\"font-size: 14pt; color: #ffcc00;\"><strong><a style=\"color: #ffcc00;\" href=" + process.env.NEXT_PUBLIC_APP_URL + " target=\"_blank\" rel=\"nofollow noopener noreferrer\">Play Now</a></strong></span></p>\n",
