                    "id": "cG9zdDozMTk2",
                    "excerpt": "<p>The rake at our cash game tables is periodically reviewed and adjusted to remain in line with the value of Bitcoin. The current rake schedule can be found in the FAQ section. An archive of all past rake schedules can also be viewed for reference.</p>\n",
                    "content": "<p>The rake at our cash game tables is periodically reviewed and adjusted to remain in line with the value of Bitcoin.</p>\n<p>The current rake schedule can be found in the <a href=\"https://swcpoker.club/posts/faq/poker\">FAQ</a> section.</p>\n<p>An<a href=\"https://swcpoker.club/old-rake\"> archive of all past rake schedules</a> can also be viewed for reference.</p>\n",
