                    "id": "cG9zdDozMDQy",
                    "excerpt": "<p>Bad Beat Jackpot All-Time High Attention all Bitcoin poker players, the Bad Beat Jackpot is currently at an all-time high of over 6,000,000 μBTC! That&#8217;s right &#8211; over 6 bitcoins are waiting to be won! To qualify, play at the specially named &#8220;Jackpot&#8221; No Limit Hold&#8217;em tables found in the cash game lobby. At least &hellip; <a href=\"https://swcpoker.club/posts/bitcoin-jackpots/bad-beat-jackpot-over-6-btc\" class=\"more-link\">Continue reading<span class=\"screen-reader-text\"> &#8220;Bad Beat Jackpot Over 6 BTC&#8221;</span></a></p>\n",
                    "content": "<h2><span style=\"color: #ffcc00;\">Bad Beat Jackpot All-Time High</span></h2>\n<p>Attention all Bitcoin poker players, the Bad Beat Jackpot is currently at an all-time high of over 6,000,000 μBTC! That&#8217;s right &#8211; over 6 bitcoins are waiting to be won!</p>\n<p>To qualify, play at the specially named &#8220;<a href=\"/posts/bitcoin-jackpots/bad-beat-jackpot-starting-at-100k\">Jackpot</a>&#8221; No Limit Hold&#8217;em tables found in the cash game lobby.</p>\n<p>At least four players must be dealt into the hand, and the qualifier for a bad beat is losing with Aces Full of Kings or better. Both players must use both hole cards for a qualifying Full House or Straight Flush, and pocket pairs are required for a qualifying Four of a Kind.</p>\n<p>But that&#8217;s not all &#8211; we&#8217;ve also added new Jackpot tables with antes, offering players another exciting way to compete for their share of over 6 bitcoins.</p>\n<p>So why wait? Join the action at SwC Poker and turn your next bad beat into a big win!</p>\n",
