                    "id": "cG9zdDoyOTY0",
                    "excerpt": "<p>It&#8217;s that time of year again, baby! The March Madness Poker Tournament is back, and it&#8217;s our biggest and best poker series ever! This 17-day series is jam-packed with 62 bitcoin poker events that will have you jumping out of your seat. It&#8217;s gonna be awesome, baby! March Madness Poker Tournament Itinerary We&#8217;ve got some &hellip; <a href=\"https://swcpoker.club/posts/bitcoin-poker-tournaments/march-madness-over-3-btc-gtd\" class=\"more-link\">Continue reading<span class=\"screen-reader-text\"> &#8220;March Madness: Over 3 BTC GTD&#8221;</span></a></p>\n",
                    "content": "<p>It&#8217;s that time of year again, baby! The March Madness Poker Tournament is back, and it&#8217;s our biggest and best poker series ever!</p>\n<p>This 17-day series is jam-packed with 62 bitcoin poker events that will have you jumping out of your seat. It&#8217;s gonna be awesome, baby!</p>\n<h6>March Madness Poker Tournament Itinerary</h6>\n<p>We&#8217;ve got some serious ballers joining us for the 10k High Roller Event on Friday, March 31st. If you&#8217;re more of a long distance shooter than a high riser, you don&#8217;t want to miss the &#8220;3 Point Contest&#8221; taking place the same night. This 500 μBTC buy-in event with 33 μBTC rebuys, 3 minute levels, and a 33,333 prize pool GTD will have you shooting for the stars.</p>\n<h6>Guaranteed prize pool of 300,000 μBTC</h6>\n<p>The Main Event headlines the series, taking place on April 2nd with a guaranteed prize pool of 300,000 μBTC. This is your chance to take the court against the best and bring home the championship trophy, baby!</p>\n<p>You can punch your ticket to the Main Event in one of our Super Satellites, each with 4 seats GTD, running every Saturday and Wednesday beginning on March 18th.</p>\n<h6>The Big Dance Freeroll</h6>\n<p>But that&#8217;s not all, folks! The top 64 players on the March Madness Series Leaderboard will qualify for The Big Dance Freeroll. A tournament where the cream of the crop will compete for even more prizes and bragging rights. You&#8217;re gonna have to be a real PTP&#8217;er to make the dance, we&#8217;re talking a primetime player, baby!</p>\n<p>The Big Dance begins play on April 3rd as a regular tournament and will play from 64 players down to 16. The Sweet 16 resumes on April 4th as a 16 player Heads-Up Shootout.</p>\n<h6>It&#8217;s March Madness, baby!</h6>\n<p>The competition is gonna be fierce. But with the right strategy and a little bit of luck, you could be cutting down the nets and hoisting that championship trophy. So get ready to bring your A-game and leave it all on the table!</p>\n<p><img decoding=\"async\" loading=\"lazy\" class=\"alignnone\" style=\"width: 800px;\" src=\"/static/c7ae7477ac84c63453952c1181458571/ny9ha79.png\" alt=\"March Madness Poker Tournament Schedule\" width=\"472\" height=\"3400\" /></p>\n",
