                    "id": "cG9zdDoyNzQ4",
                    "excerpt": "<p>Yo, bitcoin poker players! Are you ready to step into the ring and claim victory? PKO Week III is here, and it&#8217;s time to show the competition who the real champion is. From January 30th to February 5th, we&#8217;re bringing you the most intense week of Knockout tournaments yet. Earn leaderboard points by knocking out &hellip; <a href=\"https://swcpoker.club/posts/bitcoin-poker-tournaments/pko-week-iii-begins-jan-30th\" class=\"more-link\">Continue reading<span class=\"screen-reader-text\"> &#8220;PKO WEEK III BEGINS JAN 30TH&#8221;</span></a></p>\n",
                    "content": "<p>Yo, bitcoin poker players! Are you ready to step into the ring and claim victory? PKO Week III is here, and it&#8217;s time to show the competition who the real champion is.</p>\n<p>From January 30th to February 5th, we&#8217;re bringing you the most intense week of Knockout tournaments yet.</p>\n<p>Earn leaderboard points by knocking out your opponents and collecting their bounties. And if you&#8217;re smart, you&#8217;ll register early to receive a 1.5x leaderboard point bonus.</p>\n<p>The top 16 finalists on the PKO Week Leaderboard qualify for the Total PKO Freeroll on February 6th, with 100% of prize money allocated to the bounty pool.</p>\n<p>It&#8217;s time to train hard and go the distance, this is your chance to climb the ranks to the top!</p>\n<p>So, put on your gloves, and let&#8217;s get ready to rumble!</p>\n<p style=\"text-align: center;\"><img decoding=\"async\" src=\"/static/fcf79d7527da57856ef87e47a0075b51/JJDXoSYxbg.png\" alt=\"\" class=\"lazy\" style=\"width: 800px;\" width=\"472\"></p>\n",
