                    "id": "cG9zdDo1ODI=",
                    "excerpt": "<p>Enjoy our Big and Medium BTC Tournaments on Sundays now at lowered cost. For the rest of the year, we are reducing the price to enter Big and Medium BTC. </p>\n",
                    "content": "\n<p>Enjoy our Big and Medium BTC Tournaments on Sundays now at lowered cost. For the rest of the year, we are reducing the price to enter Big and Medium BTC.</p>\n\n\n\n<p>The Big BTC will cost 3500 UBTC and Medium BTC is reduced to 1500 UBTC.</p>\n\n\n\n<p>&nbsp;</p>\n",
